import React from 'react';
import './Project.css';
import projectimages from '../ImagesLogo/project1.png';
import { Link } from 'react-router-dom';

function Project() {
    return (
        <div id='projects' className='projects'>
            <div className="project-title">
                <h1>Projects</h1>
            </div>
            <div className="project-all" >
                {data.map((h) =>
                    <div className='project-boxes' key={h.id} >
                         <h4>{h.Name}</h4>
                        <div  className='project-lists'>
                            <img src={h.img} alt=''  />
                            <div className="project-info">
                                <p>{h.description}</p>
                                <div className='project-link'>
                                    <Link to={h.link}  className='project-links'>Preview</Link>
                                </div>
                            </div>
                        </div>
                    </div>
                )}
            </div>
        </div>
    )
}

const data = [
    {
        id: 1,
        Name: 'Netflix Landing Page',
        img: projectimages,
        description: '"Netflix-style landing page built with React.js,featuring responsive design and interactive elements"',
        link:'https://netflix-loading-clonepage.web.app/'
    },
    {
        id: 2,
        Name: 'E-Commerce',
        img: projectimages,
        link:''
    },
    {
        id: 3,
        Name: 'Netflix Landing Page',
        img: projectimages,
        link:''
    },
   
]

export default Project
